                'name' => '{"en":"Docs Outside the Box","hi":"औद्योगिक डिज़ाइन","ar":"الذكاء الاصطناعي"}',
                'description' => '{"en":"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Curabitur pretium tincidunt lacus. Nulla gravida orci a odio. Nullam varius, turpis et commodo pharetra, est eros bibendum elit, nec luctus magna felis sollicitudin mauris. Integer in mauris eu nibh euismod gravida. Duis ac tellus et risus vulputate vehicula. Donec lobortis risus a elit. Etiam tempor. Ut ullamcorper, ligula eu tempor congue, eros est euismod turpis, id tincidunt sapien risus a quam. Maecenas fermentum, sem in pharetra pellentesque.","hi":"लोरेम इप्सम डोलर सिट अमेट, कॉन्सेक्टेचर अडिपिसिंग एलीट. सेड डो ईयूसमोड टेम्पोर इन्सीडिडुंट उत लेबोरे एट डोलोरे मैग्ना एलिक्वा. उत एनीम अद मिनिम वेनिआम, क्विस नोस्त्रुड एक्सर्सिटेशन उल्लाम्को लेबोर्स निसी उत अलीक्विप एक्स ए कोमोडो कोन्सेक्वात. डुइस औटे इरुरे डोलोर इन रेप्रिहेंडेरिट इन वोलुप्टेटे वेलिट एसे सिल्लुम डोलोरे यू फुगिअट नल्ला pariatur. एक्सेप्तेउर सिन्न्त ओककेकाट कपिडटात नोन प्रोइडेंट, सुंट इन कुल्पा क्वि ओफ्फिसिअ डेसेरुंत्त मोल्लिट एनिम इड एस्ट laborum. कुरबीतुर प्रेटियम टिंसिडुंट लाकुस. नुल्ला ग्रविधा ओर्सी अ ओडिओ. नुल्लम वारिउस, turpis एट commodo फेरेत्रा, एस्ट एरोस बिबेंदुम एलीट, नेक luctus magna felis sollicitudin mauris. इंटेगेर इन mauris यू nibh euismod gravida. डुइस अच tellus","ar":"لوريم ايبسوم دولار سيت أميت، كونسكتتور أديبيسشينغ إيليت. سيد دو إيوسيمود تيمبور إنسيديدونت أوت لابوري إت دولوري ماغنا أليكا. أوت إينيم أد مينيم فينيام، كويز نوسترود إكسرسيتاشيون أولامكو لابوريس نيسي أوت أليكويب إكس إيا كومودو كونسيكوات. دويس أوتي إيرور دولور إن ريبرهينديريت إن فولوبتات فيليت إيس سيليم دولور يو فوجيات نولا بارياتور. إكسسيبتور سنت أوككاكات كيوبيدتات نون برويدينت، سونت إن كولبا كي أوفيسيا ديسيريونت مولليت أنيم إد إست لابوروم. كيوريبيتور بريتيوم تينسيدونت لاكوس. نيولا غرافيدا أورسي أ أوديو. نيولام فارياس، توربيس إت كومودو فهرترا، إست إيروس بيبيندوم إيليت، نيك لوكتوس ماغنا فيليس سولليتشيتودين ماوريس. إنتيغر إن ماوريس يو نيبه إيوسيمود غرافيدا. دويس أك تيلوس إت ريزيز فلفوتا فيهيكول"}',
